import React from 'react';
import Particles from 'react-tsparticles';
import icon1 from '../images/gear.png' // Replace with actual paths
import icon2 from '../images/js.png' // Replace with actual paths
// ... import other icons

const ParticlesBackground = () => {
  return (
    <Particles
      params={{
        particles: {
          number: {
            value: 10, // Adjust the number of icons
          },
          shape: {
            type: 'image',
            image: [
              { src: icon1 },
              { src: icon2 },
              // ... add other icons
            ],
          },
          size: {
            value: 20, // Adjust icon size
          },
          move: {
            speed: 2, // Adjust movement speed
          },
        },
      }}
    />
  );
};

export default ParticlesBackground;
